def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros(len(bins))
    sorted_bins = np.argsort(bins)

    for i, bin_idx in enumerate(sorted_bins):
        remaining_capacity = bins[bin_idx] - item
        if remaining_capacity >= 0:
            priorities[bin_idx] = i + 1
        else:
            min_capacity = float('inf')
            min_capacity_idx = -1
            for j in range(i, len(bins)):
                if bins[sorted_bins[j]] >= item:
                    current_capacity = bins[sorted_bins[j]] - item
                    if current_capacity < min_capacity:
                        min_capacity = current_capacity
                        min_capacity_idx = sorted_bins[j]

            if min_capacity_idx != -1:
                priorities[min_capacity_idx] = i + 1

    return priorities
